	"sap/ushell/plugins/rta-personalize/i18n/i18n_ca.properties":'# Resource bundle for personalize ushell plug-in\n# __ldi.translation.uuid=71db0b00-f74a-11e6-9598-0800200c9a66\n\n# Copyright (c) 2015 SAP SE, All Rights Reserved\n\n#XTIT\nPERSONALIZE_BUTTON_TEXT=Personalitzar aplicaci\\u00F3\n#XTIT\nEND_PERSONALIZE_BUTTON_TEXT=Sortir del mode de personalitzaci\\u00F3\n#XTIT\nERROR_TITLE=Error\n#XTIT: Application title of the FLP plugin in app descriptor\nAPP_TITLE=Personalitzar connector FLP\n\n#XMSG: Error Message when using unsupported Browser\nMSG_UNSUPPORTED_BROWSER=Esteu utilitzant un navegador que no s\'admet. Utilitzeu Google Chrome o Microsoft Internet Explorer (versi\\u00F3 10 o posterior).\n#XMSG: Error Message when Personalize UI could not be started\nMSG_STARTUP_FAILED=No es pot iniciar el mode de personalitzaci\\u00F3\n#XTIT: Title of the ErrorMessage Window\nTIT_UNSUPPORTED_BROWSER=No s\'admet el navegador\n#XMSG: Information Message when, after starting, the screen can\'t be personalized\nMSG_STARTUP_NO_OVERLAYS=Aquesta pantalla no es pot personalitzar\n#XMSG: Message when we close and save RTA successfully\nSAVE_SUCCESSFUL=S\'han desat les modificacions\n',
	"sap/ushell/plugins/rta-personalize/i18n/i18n_cs.properties":'# Resource bundle for personalize ushell plug-in\n# __ldi.translation.uuid=71db0b00-f74a-11e6-9598-0800200c9a66\n\n# Copyright (c) 2015 SAP SE, All Rights Reserved\n\n#XTIT\nPERSONALIZE_BUTTON_TEXT=Personalizace app\n#XTIT\nEND_PERSONALIZE_BUTTON_TEXT=Opustit re\\u017Eim personalizace\n#XTIT\nERROR_TITLE=Chyba\n#XTIT: Application title of the FLP plugin in app descriptor\nAPP_TITLE=Personalizace pluginu FLP\n\n#XMSG: Error Message when using unsupported Browser\nMSG_UNSUPPORTED_BROWSER=Pou\\u017E\\u00EDv\\u00E1te nepodporovan\\u00FD prohl\\u00ED\\u017Ee\\u010D. Pou\\u017Eijte Chrome nebo Internet Explorer (verze 10 nebo vy\\u0161\\u0161\\u00ED).\n#XMSG: Error Message when Personalize UI could not be started\nMSG_STARTUP_FAILED=Personaliza\\u010Dn\\u00ED re\\u017Eim nelze spustit.\n#XTIT: Title of the ErrorMessage Window\nTIT_UNSUPPORTED_BROWSER=Prohl\\u00ED\\u017Ee\\u010D nen\\u00ED podporov\\u00E1n\n#XMSG: Information Message when, after starting, the screen can\'t be personalized\nMSG_STARTUP_NO_OVERLAYS=Tuto obrazovku nelze personalizovat.\n#XMSG: Message when we close and save RTA successfully\nSAVE_SUCCESSFUL=Va\\u0161e zm\\u011Bny byly ulo\\u017Eeny.\n',
