	"sap/ushell/plugins/rta-personalize/i18n/i18n_de.properties":'# Resource bundle for personalize ushell plug-in\n# __ldi.translation.uuid=71db0b00-f74a-11e6-9598-0800200c9a66\n\n# Copyright (c) 2015 SAP SE, All Rights Reserved\n\n#XTIT\nPERSONALIZE_BUTTON_TEXT=App personalisieren\n#XTIT\nEND_PERSONALIZE_BUTTON_TEXT=Personalisierungsmodus verlassen\n#XTIT\nERROR_TITLE=Fehler\n#XTIT: Application title of the FLP plugin in app descriptor\nAPP_TITLE=FLP-Plugin personalisieren\n\n#XMSG: Error Message when using unsupported Browser\nMSG_UNSUPPORTED_BROWSER=Sie verwenden einen nicht unterst\\u00FCtzten Browser. Bitte verwenden Sie Google Chrome oder Microsoft Internet Explorer (Version 10 oder h\\u00F6her).\n#XMSG: Error Message when Personalize UI could not be started\nMSG_STARTUP_FAILED=Der Personalisierungsmodus kann nicht gestartet werden.\n#XTIT: Title of the ErrorMessage Window\nTIT_UNSUPPORTED_BROWSER=Browser wird nicht unterst\\u00FCtzt\n#XMSG: Information Message when, after starting, the screen can\'t be personalized\nMSG_STARTUP_NO_OVERLAYS=Dieses Bild ist nicht personalisierbar.\n#XMSG: Message when we close and save RTA successfully\nSAVE_SUCCESSFUL=Ihre \\u00C4nderungen wurden gesichert.\n',
