	"sap/ushell/plugins/rta-personalize/i18n/i18n_lt.properties":'# Resource bundle for personalize ushell plug-in\n# __ldi.translation.uuid=71db0b00-f74a-11e6-9598-0800200c9a66\n\n# Copyright (c) 2015 SAP SE, All Rights Reserved\n\n#XTIT\nPERSONALIZE_BUTTON_TEXT=Personalizuoti program\\u0105\n#XTIT\nEND_PERSONALIZE_BUTTON_TEXT=I\\u0161eiti i\\u0161 personalizacijos re\\u017Eimo\n#XTIT\nERROR_TITLE=Klaida\n#XTIT: Application title of the FLP plugin in app descriptor\nAPP_TITLE=Personalizuoti FLP pried\\u0105\n\n#XMSG: Error Message when using unsupported Browser\nMSG_UNSUPPORTED_BROWSER=Deja, j\\u016Bs\\u0173 nar\\u0161ykl\\u0117 nepalaikoma. Naudokite \\u201EGoogle Chrome\\u201C arba \\u201EMicrosoft Internet Explorer\\u201C (10 ar v\\u0117lesn\\u0119 versij\\u0105).\n#XMSG: Error Message when Personalize UI could not be started\nMSG_STARTUP_FAILED=DEja, nepavyko paleisti personalizacijos re\\u017Eimo.\n#XTIT: Title of the ErrorMessage Window\nTIT_UNSUPPORTED_BROWSER=Nepalaikoma nar\\u0161ykl\\u0117\n#XMSG: Information Message when, after starting, the screen can\'t be personalized\nMSG_STARTUP_NO_OVERLAYS=Deja, \\u0161io ekrano personalizuoti negalima.\n#XMSG: Message when we close and save RTA successfully\nSAVE_SUCCESSFUL=J\\u016Bs\\u0173 pakeitimai \\u012Fra\\u0161yti.\n',
